async function GetItems() {
  const response = await fetch("https://panda-market-api.vercel.app/products");
  const result = await response.text();
  const items = await JSON.parse(result);
  return items;
}

function Item({ item }) {
  return (
    <div>
      <img className="content-img" scr={item.image} alt={item.name} />
      <div>
        <h2>{item.name}</h2>
        <p>{item.name}</p>
        <p>{item.price} Ïõê</p>
        <p>{item.favoriteCount}</p>
      </div>
    </div>
  );
}

function ItemList({ items }) {
  return (
    <ul className="itmes">
      {items.map((item) => (
        <li>
          <Item item={item} />
        </li>
      ))}
    </ul>
  );
}

export default ItemList;
